        "name": "Laura Kampf",
        "descriptionDe": "Laura Kampf ist eine Makerin! Da klingelt erstmal nichts? Zur Erklärung: Sie baut in ihrer Werkstatt verrückte Dinge und stellt Videos vom Bauprozess auf Youtube – über 300.000 Nutzer folgen ihr auf der Plattform. Egal ob Beer-Bike, ein Fahrrad-Kinder-Karussell, ein tiny house oder ein bohrmaschinen betriebenes Floß, mit jedem Workshop, jedem neuen Projekt schärft underweitert Laura ihre Fertigkeiten und motiviert die ganze Welt zum selberbauen. Darüber hinaus taucht sie immer wieder in der \"Sendung mit der Maus\" auf und hat auch schon mit Mythbusters-Legende Adam Savage einen Flaschenöffner gebaut! ",
        "descriptionEn": "Laura Kampf is a maker! Not ringing any bells? She creates crazy things in her workshop and uploads videos of the creation process to her YouTube channel–and her 300,000 followers. Whether it’s a beer bike, a children’s bicycle carousel, a tiny house and a drill-propelled raft, every new workshop and project sharpens and expands Kampf’s skillset and motivate the world to engaging in DIY activities. Furthermore, she appears in seminal German kids show \"Sendung mit der Maus\" and has built a bottle opener with Mythbusters legend Adam Savage.",
