        "descriptionDe": "Talisa Tossell hat ihre Social-Media-Karriere schon 2016 gestartet und ist direkt auf den großen Trend \"Schleim\" aufgesprungen. Mit Tutorials auf Youtube, wie Nutzende selbst Schleim herstellen können (sehr beliebt bei der Gen Z), begeistert sie mittlerweile zwei Millionen Abonnent:innen auf der Plattform – und 900.000 Follower auf Instagram. Mittlerweile postet sie auch regelmäßig auf Tiktok und Snapchat und baut auf allen Kanälen eine starke Community auf.",
