        "name": "Maik Kleinschmidt",
        "descriptionDe": "Dr. Maik Kleinschmidt ist seit 2019 Director Marketing Europe bei C&A und zuständig für die Markenführung und Marketingaktivitäten in allen online und offline Kanälen in den 18 europäischen Ländern. Unter seiner Leitung konzentriert sich C&A auf die Markenstärkung und -modernisierung und den Ausbau der digitalen Kanäle. Sein Team arbeitet über die Kanal- und Ländergrenzen hinweg an einer integrierten Kundenkommunikation. Maik hat in den letzten 15 Jahren mit führenden Marken und Retailern aus dem Fashion- und Konsumgüterbereich an Wachstumsstrategien gearbeitet. Er war zuvor als Geschäftsführer für Digital und Marketing bei der Tom Tailor Group und als Berater für Marketing und Vertriebs-Transformationen bei The BCH tätig.",
        "descriptionEn": "Dr. Maik Kleinschmidt has been Director Marketing Europe at C&A since 2019 and is responsible for brand management and marketing activities in all online and offline channels in 18 European countries. Under his leadership, C&A focuses on brand strengthening and modernization and the expansion of digital channels. His team works across channel and country borders on integrated customer communication. Maik has been working on growth strategies with leading brands and retailers in the fashion and consumer goods sector for the past 15 years. He previously served as managing director of digital and marketing at Tom Tailor Group and as a marketing and sales transformation consultant at The Boston Consulting Group.",
