        "name": "Robert  Becker",
        "descriptionDe": "Wie sieht die Zukunft von t-online aus? Am Bildschirm von Robert Becker, Programm-Manager bei Ströer, scheint man der Antwort auf die Frage ein Stück näher zu sein. Der 48-jährige betreut aktuell den Neuaufbau der Plattform des Nachrichtenportals. Angefangen hat es vor knapp zwei Jahren mit dem Einstieg in das Projekt. Die Entwicklungsprozesse wurden optimiert und die Teams neu ausgerichtet.\nZuvor war er 10 Jahre in der Schweiz. Erfahrungen mit journalistischen Produkten sammelte er als Chef vom Dienst beim Handelsblatt. Seine Kreativität nutzt der gebürtige Berliner nicht nur im Beruf. Als Musiker  spielte er auch schon vor mehr als 50.000 Zuschauern inkl. Kompliment von Farin Urlaub. Eine ewige Ermutigung auch in schwereren Projektzeiten.",
        "descriptionEn": "What does the future of t-online look like? On the screen of Robert Becker, Program Manager at Ströer, the answer to the question seems to be a little closer. The 48-year-old is currently overseeing the relaunch of the news portal's platform. It all started almost two years ago when he joined the project. The development processes were optimized and the teams realigned.\nBefore that, he spent 10 years in Switzerland. He gained experience with journalistic products as chief of staff at Handelsblatt. The Berlin native does not only use his creativity in his job. As a musician, he has also played in front of more than 50,000 spectators. An encouragement even in difficult project times.\n\nTranslated with www.DeepL.com/Translator (free version)",
