        "name": "Paul Ripke",
        "descriptionDe": "Paul Ripke ist abseits von Fashion-Bloggern, Youtubern und Promikickern einer der wenigen deutschen Instagram-Stars mit einer eigenen Stimme und eigenem Charakter. Gestartet ist er als Fotograf von Marteria und einigen deutschen Nationalspielern. Plötzlich stand er 2014 nach dem WM-Finale auf dem Rasen in Rio und wurde mit seinen Fotos deutschlandweit bekannt. Später begleitete er zum Beispiel Lewis Hamilton während der Formel-1-Saison und etablierte mit seinem Kumpel Joko Winterscheidt den Podcast \"Alle Wege führen nach Ruhm\" (AWFNR). Mit Pari hat Paul eine eigene Klamottenmarke gebaut und als Botschafter verschiedener Marken wie z.B. IWC zeigt er, dass er selbst zur Personal Brand geworden ist.",
        "descriptionEn": "Paul Ripke is a fashion blogger, Youtuber and German Instagram stars. He got his start as photographer for German hip-hop artist Marteria and some members of the German national team. In 2014, he was on the pitch after the World Cup final in Rio and became a household name in Germany with his shots of the German victory. Today, he accompanies Lewis Hamilton during the Formula 1 season and co-hosts the popular German podcast Alle Wege führen nach Ruhm (AWFNR).",
