        "name": "Maurice Moitroux",
        "descriptionDe": "Maurice Moitroux leitet das globale Brand Marketing für das Unternehmen IWC Schaffhausen. In seiner Funktion ist er verantwortlich für die Positionierung der Marke als auch das globale Storytelling über die verschiedenen Marketingkanäle. Bevor Maurice 2021 in die erweiterte Geschäftsleitung der Uhrenmanufaktur berufen wurde hat er in unterschiedlichen Positionen die Bereiche Media, Content, Digitales Marketing und Werbung / Kampagnen geführt. Nach seinem Marketing Studium startete Maurice seine Laufbahn 2010 bei Jung von Matt. Während dieser Zeit hat er Kampagnen und Digitalprojekte zusammen mit unterschiedlichen Kunden konzipiert und umgesetzt. Maurice wirkt neben seiner beruflichen Laufbahn als Gastdozent für Markenführung und Digitale Kommunikation und engagiert sich in verschiedenen Web3 Interessensgruppen zu den Themen Metaverses, Crypto, NFT und den damit verbundenen Technologien und Anknüpfungspunkten für Unternehmen.",
