        "descriptionDe": "Dr. Mirko Caspar studierte BWL an der Westfälischen Wilhelms-Universität Münster. Anschließend promovierte er bei Professor Heribert Meffert über Markenstrategien. Dr. Caspar arbeitete bei McKinsey als Unternehmensberater mit Schwerpunkt Strategie, Marketing und Brand-Management, bevor er in eine Führungsposition bei Universal Music Deutschland wechselte. 2006 war er Mitbegründer des Virtual-World-Unternehmen Metaversum, wo er als einer der Geschäftsführer fungierte. Zudem war er Mitbegründer der Agenturen Userlutions GmbH und Caspar-Feld Marketing-Performance GmbH. Seit 2011 ist er bei Mister Spex und verantwortet dort als Co-CEO und Vorstand die Bereiche Marketing, Category-Management, Product-Management sowie die Retail-Stores und internationalen Märkte.",
