        "name": "Dirk Otto",
        "descriptionDe": "Nach Stationen als Client Lead bei Grey, BBDO, DDB, Saatchi & Saatchi und als Marketing Consultant für Digitas & Publicis Media verantwortet Dirk Otto seit 2018 das nationale & internationale Marketing von Eurowings, dem führenden europäischen Value Carrier der Lufthansa Group. Dort ist er für alle Fragen der Marken-, Marketingstrategie und Aktivierung zuständig und treibt die digitale Transformation des Marketings und Neupositionierung der Marke in Zeiten großer Krisen und Umbrüche voran. Er ist ein zukunftsorientierter Verfechter eines kunden- und datenbasierten Marketingansatzes, der stets den Menschen und die Erkenntnisse in den Mittelpunkt stellt, mit dem Ziel, \"Werte ausgehend vom Verbraucher zu schaffen.\"",
        "descriptionEn": "After positions as Client Lead at Grey, BBDO, DDB, Saatchi & Saatchi and as Marketing Consultant for Digitas & Publicis Media, Dirk Otto has been responsible for the national & international marketing of Eurowings, the leading European value carrier of the Lufthansa Group, since 2018. There, he is agnostically responsible for all matters of brand, marketing strategy and activation driving the digital transformation of marketing and the repositioning of the brand in times of great crisis and change. He is a forward-thinking believer in a customer-focused & data-based marketing approach, that is not reduced to optimizing ad placements but always keeps people and insights in focus, with the goal of \"creating value starting from the consumer.\"",
