        "name": "Frank Thelen",
        "descriptionDe": "Durch seine Beteiligung an der TV-Show \"Die Höhle der Löwen\" ist Frank Thelen vermutlich der in der breiten Öffentlichkeit bekannteste Tech-Investor Deutschlands. Seit 2010 ist er als Investor aktiv. Der 46-Jährige gehörte zu den ersten Investor in Startups wie Lilium Aviation, Wunderlist, Xentral, Ankerkraut und YFood. Mit seiner Autobiografie \"Startup-DNA\" und seinem zweiten Buch \"10xDNA\" erreichte er jeweils die Spiegel Bestseller-Liste.",
        "descriptionEn": "Frank Thelen first made his name through “Die Höhle der Löwen,“ the German version of Shark Tank or Dragon’s Den, depending on which side of the Atlantic you’re from. Thelen is now the most-prominent tech investor in Germany. Thelen’s track record includes numerous notable exits, including 6Wunderkinder (sold to Microsoft), Mytaxi (sold to Daimler) and Kaufda (taken over by Axel Springer).",
