        "name": "Emre Dogan",
        "descriptionDe": "Emre ist Direktor in Googles Ads-Abteilung für Zentraleuropa und verantwortlich für die Vertriebs- und Account-Management-Aktivitäten auf dem deutschen Markt. Seine Leidenschaft ist es, Unternehmen dabei zu helfen, durch Technologie mit ihren Kunden in Kontakt zu treten. In seinen mehr als 11 Jahren bei Google hat er mit über 500 Unternehmen zusammengearbeitet, um ihnen zu helfen, ihre Marketing- und Geschäftsziele durch digitale Lösungen zu erreichen. Emre ist einer der Executive Sponsors für Search und Performance Ads in EMEA. Er unterstützt die Entwicklung und Umsetzung neuer Lösungen und stellt sicher, dass das Kundenfeedback in der Produktentwicklung ankommt und umgesetzt wird. Emre ist auch ein leidenschaftlicher Coach und Mentor für junge und aufstrebende Talente aus unterrepräsentierten Gruppen.",
        "descriptionEn": "Emre is a director in Google’s Ads division for Central Europe and responsible for their sales and account management activities for the German market. He is passionate about helping businesses connect with their customers through technology. Throughout his 11+ years at Google, he has directly worked with more than 500 businesses to help them achieve their marketing and business objectives through digital solutions. Emre is one of the Executive Sponsors for Search and Performance Ads in EMEA, supporting the development and incubation of new solutions and ensuring customer feedback is received and actioned in the Product organization. Emre is also a passionate coach and mentor for youth and emerging talent from underrepresented groups. ",
