        "name": "David Löwe",
        "descriptionDe": "Seit Ende 2019 sagt everdrop Plastikmüll und Umweltverschmutzung den Kampf an. Bereits 6 Millionen Plastikflaschen hat das Start-up für nachhaltige Haushaltsprodukte mit seiner Community eingespart. everdrop steht neben Nachhaltigkeit aber auch für Innovation und gutes Design – und ein großartiges Team, das eine gemeinsame Überzeugung hat: Die Welt jeden Tag ein bisschen sauberer machen zu wollen. Im Herzen dieses Teams: die beiden Gründer Chris Becker und David Löwe. Vor everdrop war David Löwe viele Jahre bei Hubert Burda Media im Verlagswesen und später mit seiner Kreativagentur für Konsumprodukte tätig.",
        "descriptionEn": "Since the end of 2019, everdrop has declared the battle against plastic waste and environmental pollution. The start-up for sustainable household products has already saved 6 million plastic bottles with its community. In addition to sustainability, everdrop also stands for innovation and good design - and a great team that has a common conviction: To make the world a little cleaner every day. At the heart of this team: founders Chris Becker and David Löwe. Before everdrop, David Löwe worked at Hubert Burda Media in publishing for many years and later with his creative agency for consumer products.",
