        "name": "Piran Asci",
        "descriptionDe": "Piran Asci ist Unternehmer, Mathematiker und Prozess-Enthusiast. Seine Begeisterung für das Unternehmertum kommt auf, als er 2014 den Funpreneur-Wettbewerb der Freien Universität Berlin gewinnt. Sein Studium und später den Einstieg bei KoRo finanziert er mit dem den An- und Verkauf von Yu-Gi-Oh!- und Pokémon-Karten. Im Jahr darauf steigt er als Werkstudent bei KoRo ein und erwirbt 2016 die Unternehmensanteile des damaligen Gründers. Unter seiner Leitung wächst KoRo zu einer der D2C-Storys in Deutschland. Heute macht das Unternehmen etwa 60 Millionen Euro Umsatz pro Jahr.",
        "descriptionEn": "Piran Asci, born in 1993 in Berlin, is an entrepreneur, mathematician and process enthusiast. He studied mathematics and business administration at Freie Universität Berlin. His enthusiasm for entrepreneurship came about when he won the Funpreneur Competition at Freie Universität Berlin in 2014. He financed his studies and later his start at KoRo by buying and selling Yu-Gi-Oh! and Pokémon cards. The following year he joined KoRo as a working student and in 2016 acquired the company shares of the then founder Roberts.Piran Asci is now responsible for marketing, sourcing and IT.",
