        "descriptionDe": "Lucas Vogelsang zählt zu den erfolgreichsten Reportern seiner Generation. Er war u.a. Autor für den Tagesspiegel, Zeit, Welt, Welt am Sonntag, Playboy und 11Freunde. 2010 erhielt er den Henri-Nannen-Preis, 2013 den Deutschen Reporterpreis. Für seine Reportage über seinen Wohnblock im Berliner Wedding wurde er 2015 mit dem Hansel-Mieth-Preis ausgezeichnet. 2017 erschien sein Bestseller „Heimaterde. Eine Weltreise durch Deutschland“. 2021 folgte sein gefeiertes Fußball-Buch „ZEITLUPEN. Denn der Fußball schreibt die besten Geschichten.“ Seit 2017 ist er neben Micky Beisenherz und Maik Nöcker Teil des wöchentlich erscheinenden Podcasts FUSSBALL MML.",
