        "name": "Maik Nöcker",
        "descriptionDe": "Schon immer Medien. Schon immer Interesse für Marken. Das ist vielleicht einer der Gründe, warum aus dem Podcast „FUSSBALL MML“ eine Firma und Marke entstanden ist. Angefangen als Moderator für Radio und TV (u.a. Radio Hamburg, Kabel 1) wechselte Maik auch immer gerne die Seiten. So betreute er während der Fußball WM 2006 u.a. Marken wie Philips und eBay. 2012 landete der Wahl-Hamburger beim FC St. Pauli und wenig später beim TV-Sender Sky, wo er mehrere Sendungen moderierte. Seit 2017 gehört er neben Micky Beisenherz und Lucas Vogelsang zudem zum Ensemble von FUSSBALL MML.",
