        "name": "Christoph Kramer",
        "descriptionDe": "Christoph Kramer ist Fußball-Weltmeister und Bundesliga-Star. Der Mittelfeldspieler von Borussia Mönchengladbach überzeugt nicht nur als kämpferischer Leistungsträger, sondern auch durch faires und loyales Auftreten. Sein Karriere-Highlight, den WM-Triumph, erlebte der 31-Jährige 2014 im Dress der Nationalmannschaft. 2018 wurde Kramer vom Stern zur „Entdeckung der WM“ gekürt - ohne dafür eine Minute auf dem Spielfeld zu verbringen. Zum ersten Mal war Kramer abseits des Rasens als Experte für das ZDF tätig und überzeugte durch präzise Analysen. Kramer kann reden und kicken - eine Fähigkeit, die nicht jeder Fußballer vorweisen kann.",
