        "name": "Asher Rapkin",
        "descriptionDe": "Asher Rapkin ist Metas Director Global Business Marketing - Facebook-App und neue Plattformen. Asher und sein Team kümmern sich um das globale Business Marketing für die Facebook-App und die neuen Plattformen von Meta: SparkAR, Augmented Reality und Virtual Reality. Bevor er diese Rolle übernahm, leitete Asher das Global Business Marketing für Messenger und WhatsApp und war der Product Marketing Communications Lead für Plattformen und SMB im Global Business Marketing Team von Meta. Bevor er zu Meta kam, war Asher Global Head of Channel Marketing für iAd bei Apple, wo er unter anderem den Markenauftritt, PR und Events leitete. Bevor er in die Technologiebranche wechselte, war Asher acht Jahre lang im Fernsehen tätig und arbeitete im Marketing für Current TV, NBCUniversal und MTV. Asher ist außerdem Eigentümer und Betreiber von Collective Horology, einer digitalen Community für passionierte Uhrensammler. ",
        "descriptionEn": "Asher Rapkin is Meta’s Director Global Business Marketing – Facebook app and Emerging Platforms. Asher and his team look after global business marketing for the Facebook app as well as Meta’s emerging platforms: SparkAR, Augmented Reality and Virtual Reality. Prior to taking on this role, Asher led Global Business Marketing for Messenger and WhatsApp and was the Product Marketing Communications Lead for Platforms and SMB on Meta’s Global Business Marketing team. Before coming to Meta, Asher was the Global Head of Channel Marketing for iAd, a division of Apple, where he oversaw the verbal and visual articulation of the brand and managed the platform's PR, events, and thought leadership work. Before shifting into tech, Asher spent eight years in television, working in Integrated Marketing for Current TV, NBCUniversal and MTV. Asher also owns and operates Collective Horology, a digital community for passionate watch collectors. ",
