        "name": "Sophia Thiel",
        "descriptionDe": "2014 startet Sophia Thiel ihre Reise in die sozialen Medien – ganz klassisch mit Facebook, YouTube und Instagram. Innerhalb kürzester Zeit wächst sie dort stark und verzeichnet mittlerweile über 3,6 Millionen Follower. Auf ihr erstes Online-Fitnessprogramm 2015 folgen drei Kochbücher, ein Trainingsbuch und ein Fitnessplaner. Ihr aktuelles Buch „Come Back Stronger“ ist im Mai 2021 erschienen und mit Gymondo ging 2022 ihr drittes Fitnessprogramm „Healthy Inside Out“ an den Start. Darüber hinaus hat Sophia in der Vergangenheit zwei erfolgreiche Sport-Kollektionen in Kooperation mit Aldi verwirklicht. Nachdem sie schon zu Beginn ihrer Laufbahn Vorreiterin im Fitness-Bereich war, lautet ihre Mission heute, die Themen Fitness und mentale Gesundheit ganzheitlicher zu betrachten und in der Gesellschaft zu etablieren.",
        "descriptionEn": " Sophia Thiel began her journey on social media in 2014, starting where so many do: on Facebook, YouTube and Instagram. She quickly grew her follower base and now has over 3.6 million subscribers. After releasing her first online fitness program in 2015, she released three cookbooks, a workout book and a fitness planner. In addition, Sophia has released two successful sports clothing collections in collaboration with Aldi. Her mission today is to take a holistic approach to fitness and mental health and to take that message to the mainstream.",
