        "name": "Verena Hubertz",
        "descriptionDe": "Verena Hubertz ist stellvertretende Fraktionsvorsitzende der SPD-Fraktion sowie direkt gewählte Bundestagsabgeordnete des Kreises Trier und Trier-Saarburg. Sie ist Gründerin sowie ehemalige Geschäftsführerin des Berliner Startups Kitchen Stories, einer videobasierten Koch-Plattform. Ende 2020 hat sie das Unternehmen verlassen, um in ihrer Heimat Politik für die Menschen vor Ort umzusetzen. Sie ist seit 2010 SPD-Parteimitglied und innerhalb der SPD-Bundestagsfraktion für die Themen Bauen, Wohnen, Wirtschaft und Tourismus zuständig.",
