        "descriptionDe": "Lisa Gradow ist stellvertretende Vorsitzende des Startup-Verbands – und damit eine der wichtigsten Stimmen der Startup-Szene in Deutschland. Aber sie ist nicht nur das. Lisa Gradow ist gleichzeitig auch Serien-Gründerin und Investorin. 2021 hat die Juristin das Software-Startup Fides Technology mitbegründet, nachdem sie zuvor bereits die Consent-Management-Plattform mit aufgebaut hatte. Mit Usercentrics entwickelte die Juristin einfache Lösungen für Unternehmen, um von Kunden beim Besuch der Website eine DSGVO-konforme Einwilligung zur Verarbeitung von Daten einzuholen. Parallel zu ihrem Job als Gründerin investiert Lisa Gradow mit dem Risikokapitalgeber LionCorn Capital als Managing Director auch in andere Startups. ",
