        "name": "Yvonne Beister",
        "descriptionDe": "Yvonne Beister ist Direktorin des Axel Springer Brand Studios, der größten Content Marketing Unit des Axel Springer Verlags. Dort setze sie mit ihrem Team aus Strategen und Kreativen insgesamt mehr als 1000 crossmediale Kampagnen für alle großen deutschen Marken um.  Die Berlinerin wurde dafür dreifach mit dem Native Advertising Award ausgezeichnet, für den Nova-Award des BdZV nominiert.  Bis 2016 verantwortete Yvonne Beister das Unterhaltungsressort der BILD-Zeitung, dem größten Leitmedium Europas und gewann 2009 den Axel-Springer-Preis für junge Journalisten. 2015/2016 leitete sie das Springer-Büro in Los Angeles. Beister studierte Medienmanagement an der Ohio State University und der Columbia School of Journalism in New York. 2010 absolvierte sie die Axel Springer Akademie in Berlin.",
