        "name": "Finn Age Hänsel ",
        "descriptionDe": "Finn ist CEO und Founder der Sanity Group, die innerhalb kürzester Zeit mehr als sechs Cannabis-Unternehmen zum Erfolg gebracht haben. Schwerpunkt? Wellbeeing-Produkte und medizinisches Cannabis. Finn ist ein Serienunternehmer und Business Angel, hat sein Handwerk bei der Boston Consulting Group und der Rocket Internet SE gelernt.  Er war fünf Jahre in der Beratung (Konsumgüter, Versicherungen, Pharma) tätig, hat fünf eigene Unternehmen gegründet, darunter THE ICONIC, Berliner Berg Craft Beer, Sportsecondhand, Valmano und Petobel und er war jahrelang der Boss von Movinga, führte das Unternehmen durch die Krise.",
