        "name": "Lena Hackelöer",
        "descriptionDe": "Lena Hackelöer ist Gründerin und CEO des schwedischen Fintechs Brite Payments. Brite nutzt die Open-Banking-Technologie, um Verbrauchern und Onlinehändlern Zahlungen in Echtzeit in 21 Märkten in Europa anzubieten. Vor der Gründung von Brite war sie CEO des skandinavischen BNPL-Anbieters Qliro Financial Services (STO:QLIRO) und verbrachte mehr als sieben Jahre in führenden Positionen bei Klarna, wo sie u.a. das globale B2B-Marketing aufgebaut hat und auch maßgeblich an dem Aufbau des deutschen Marktes für Klarna beteiligt war. ",
        "descriptionEn": "Lena Hackelöer is founder and CEO of Brite Payments, a Swedish FinTech providing instant bank payments and payouts across 21 markets in Europe. Brite leverages open banking technology to process payments realtime between consumers and online merchants. A dual citizen of Sweden and Germany, Lena has extensive experience in the European FinTech sector, with a focus on payments and consumer credit. She spent 7+ years in leading positions in Klarna Bank, where her roles included Director Global Business Marketing and Director Market Growth and Strategy. Prior to founding Brite, Lena served as CEO of Qliro Financial Services (STO:QLIRO), a FinTech offering payment solutions for e-commerce and consumer credit services. ",
