        "name": "Jannika Bock",
        "descriptionDe": "Dr. Jannika Bock leitet als Managing Director Retail den Industriesektor Handel für die Google Germany GmbH. Sie ist bereits seit 2008 bei Google und war zuletzt als Director Client Solutions für den Vertrieb von Googles Werbeprodukten an Großkunden in Zentraleuropa verantwortlich. Jannika Bock ist Executive Sponsor der LGTBQ+ Community Pride@Google in Deutschland. Seit Februar 2021 ist sie zudem im Vorstand des BVDW-Ressorts „Arbeitswelt der Zukunft“. Bevor Jannika Bock zu Google wechselte, arbeitete sie u.a. für die Axel Springer AG. Sie promovierte in der amerikanischen Literatur- und Kulturwissenschaft an der Universität Hamburg und an der Harvard Universität.",
        "descriptionEn": "Dr. Jannika Bock leads the Retail Industry Sector as Managing Director for Google Germany, which she joined in 2008. Prior to her current role, she led sales activities for Google’s ads products within the Large Customer Sales organization of Central Europe. As an executive sponsor of the LGBTQ+ Community \"\"pride@Google\"\" in Germany, Jannika Bock also serves as chair for the BVDW-department \"\"Future of Work\"\".  Before joining Google, she worked for Axel Springer AG. She promoted in American literature and cultural studies at Hamburg University and Harvard University.",
