        "name": "Kai  Stübane",
        "descriptionDe": "Kai Stübane ist Executive Vice President, sowie Mitglied des Regionalen Leadership Teams der SAP-Region Mittel und Osteuropa seit 2017. Er verantwortet den Vertrieb der SAP Customer Experience Lösungen (Marketing, Sales & Service, Commerce und Customer Data Management). Kai's Passion für CX entwickelte sich bereits sehr früh, da er selbst einen Webshop betrieben hat. Er sieht sich als Corporate Influencer, ist sehr aktiv im Bereich Social Media, um aktiv den Austausch mit Fachanwendern und Entscheidern für CX über Inhalte zu suchen.",
        "descriptionEn": "As a member of the Region Leadership Team, Kai Stübane has been responsible for different Strategic Cloud Solutions for Middle and Eastern Europe (MEE) since 2017. Kai was first responsible for incubating SAP S4/HANA (public & privat) Cloud in MEE until end of 2019 and assured high end adoption through the Region. Since early 2020, Kai is now leading the SAP Customer Experience Sales Team. From 2011 to mid-2017, Kai Stübane was responsible for sales in the german market in various positions, lastly for analytical applications. In this role, he drove the business development of innovative topics in the german market, such as SAP Digital Boardroom. Kai Stübane was born in Berlin in 1980. After graduating in business administration from the School of Economics in Berlin, he worked for several years as an auditor and consultant at PricewaterhouseCoopers AG WPG. For various listed mandates, he supported the efficient implementation of compliance requirements for the internal control system and risk management.",
