        "name": "Björn Schick",
        "descriptionDe": "Björn ist seit August 2020 Director of Customer Experience und Mitglied des Vorstands bei der smart Europe GmbH. Seine wichtigste Aufgabe: Smart als sympathische Automarke auf das nächste Level heben – durch nahtlose Customer Experience. Die Strategie fußt dabei auf Insights, die aus Daten gewonnen werden und einem innovativen IT-Ökosystem, das Schick eingeführt hat.",
        "descriptionEn": "Björn Schick joined smart Europe GmbH in August 2020 as Director of Customer Experience and Member of the Executive Board. He is responsible for bringing smart as the loveable automotive brand to the next level, through seamless end-to-end customer experience, which is fully powered by data insights and build on an innovative green field IT-eco-system infrastructure. Prior to joining smart, Björn was acting in executive management roles in digital and marketing agencies: port-neo GmbH and Oddity GmbH, amongst others. For clients such as Daimler, Allianz, EnBW, Post CH, Hewlett-Packard, etc., he oversaw the business operation and organization development, provided consulting and solutions in the form of business strategy, digital transformation and modern data-driven marketing. As a visionary leader, Björn steers the company and team to challenge the status quo and push boundaries. With his extensive knowledge and experience in digital, e-commerce and marketing solutions he enables the team to strive for the best innovative solutions.",
